(69743, 4354, 5770, 1, '原地', '', '2013-12-19 00:00:00', 2000, 19, 1, 4, '原地\n  \n說好一起相愛到永久\n可知道我多麼期盼這一天\n忽然轉眼之間斷了線\n\n說過的話已飛散雲煙\n走過的路片段的眷戀\n殘缺回憶守候著從前\n\n妳要我放開 可是我離不開\n我還在等待 等待另一個未來\n妳說過的話  一句一句深埋藏在心裡\n只想再說好的原地 等妳 \n\n\n詞:JAN鋒 曲:JAN鋒\n編曲:JAN鋒 演唱:JAN鋒  \n合聲\\Mixing:JAN鋒', '', 233, '', '', '', '', 'JAN鋒', '', 0, 1, 0, '2013-12-18 22:48:29', '2015-03-12 14:03:48', '0000-00-00 00:00:00'),
(69744, 162876, 0, 1, '我不愛你了(demo)', '一直以為這趟旅行後可以寫一些很大氣的歌，結果回到台北的第一首歌，還是我愛你你不愛我的濫情歌。\n\n不管怎樣，至少，希望這首歌，可以告別環島前的自己。\n', '2013-12-15 00:00:00', 2000, 19, 1, 1, '這空蕩蕩的小房間裡\n再沒有你的聲音\n整理好要去流浪的行李\n再見的不只是你而已\n我也要告別我自己\n\n在一望無際的濱海公路\n我不想真的不想你\n海風慢慢侵蝕　每一寸記憶\n沒關係　全部都給你\n我真的　是真的　不愛你了\n\n不愛你了\n\n我不愛你了　不愛你了寶貝\n再不愛你了　管你會去愛誰\n一起做的夢和一起瘋狂的每天\n我從沒有後悔\n\n我不愛你了　不再叫你寶貝\n再不愛你了　反正你也不屑\n所有你的畫面和你走過的每一條街\n我都不愛了\n\n陽光穿過了瞳孔\n你只是個幻覺\n不需要誰來救援\n我是真的 我是真的\n真的不愛了\n\n我不愛你了　不愛你了寶貝\n再不愛你了　管你會去愛誰\n一起做的夢和一起瘋狂的每天\n我從沒有後悔\n\n所有你的畫面和你走過的每一條街\n我都不愛了\n我都不愛了\n不愛了　我不愛你了\n\n我不愛你了　不再叫你寶貝\n再不愛你了　反正你也不屑\n所有你的畫面和你走過的每一條街\n\n我都不愛了\n', '', 214, '', '野人', '野人', '', '野人', '', 1, 1, 0, '2013-12-19 00:02:22', '2015-03-12 14:03:48', '0000-00-00 00:00:00'),
(69745, 145287, 5622, 17, '自以為是的天堂（曲＋編曲：K／詞：花戀蝶＋K＋大牛）', '', '2013-02-19 00:00:00', 2000, 19, 2, 7, '＜自以為是的天堂＞ \n\n自以為是的天堂 \n自以為是的可悲的烏托邦 \n\n自以為是的真相 \n一個又一個的謊\n\n\n~前奏~\n\nA\n曾以為找到一個信仰\n相信不會有誰  再為誰受傷\n\n曾以為找到一種力量\n相信可以阻止誰  再讓誰受傷\n\nB\n所以我狂妄  自以為正義的一方\n所以我瘋狂  就算追到天涯海角\n也不曾失去力量\n\nC\n自以為是的天堂 \n自以為是的可悲的烏托邦 \n\n自以為是的真相 \n一個又一個的謊\n\nC\n自以為是的天堂 \n自以為是的可悲的烏托邦 \n\n自以為是的真相 \n一個又一個的謊', '', 115, '', '', '', '', '誰', '', 1, 1, 0, '2013-12-19 02:55:36', '2015-03-12 14:03:48', '0000-00-00 00:00:00'),
(69746, 114501, 5885, 4, '觀賞', '', '2013-06-22 00:00:00', 2000, 15, 0, 7, '只是／好朋友\n是秋水／望穿了以後\n\n忘\n抑或\n\n亡\n\n\n我只能／觀賞\n你的愛／的\n\n模樣', '', 222, '', '', '', '', 'ShoeateR', '', 0, 1, 0, '2013-12-19 05:58:11', '2015-03-12 14:03:49', '0000-00-00 00:00:00'),
(69747, 124341, 0, 1, '英雄魄', '', '2013-12-19 00:00:00', 2000, 19, 1, 7, '冰冷的寒冬  蒼白的山峰\n天迷濛  大地風起雲湧\n孤傲的刀鋒  出征的英雄\n狂亂中  誰將山河染紅\n\n壯志未酬的惶恐  旌旗遮蔽長空\n歷史塵封  血淚下的光榮  兒女情仇飄風中\n\n英雄寫下傳說  流傳千古不朽 \n生死卻躲不過  只剩孤單魂魄\n誰的江山殘破  誰的朝代殞落\n看沙場遼闊  勝負不由我  人漂泊  心葬在烽火\n', '', 224, '', '雲端', '小呂', '雲端', 'intro', '', 0, 1, 0, '2013-12-19 07:39:25', '2015-03-12 14:03:49', '0000-00-00 00:00:00'),
